import React, { Component } from 'react';
import { Button, Accordion } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import VrTrailApi from '../api/VrTrailApi';
import RunListEntry from './RunListEntry';

class RunList extends Component {

    constructor(props) {
        super(props);

        // Init an empty state
        this.state = {
          runs : [],

          open: false,
          currentUser: props.selectedUser,
          currentUserName: props.user,
          currentUserAge: null,
        };
    }

    render() {
        return (
            <>
            <button onClick={this.getRunByIdUser}>Show runs</button>
            {
                this.state.runs ?
                    <div>
                        { 
                            this.state.runs.map((item) => 
                                <Accordion>
                                    <Accordion.Item eventKey={item.id - 1}>
                                        <Accordion.Header>Durchlauf {item.id}</Accordion.Header>
                                            <RunListEntry key={this.state.runs.id} run={item} expandedState={this.state.runs.id}
                                            onExpandedStateChange={this.onExpandedStateChange}
                                            />
                                        </Accordion.Item>
                                </Accordion>
                            )
                        }
                    </div>
                : null
            }
            </>
        );
    }
  }
  export default RunList;
